マジカルアートシートは、高耐候塩ビシートの表面にカーボン柄の凹凸をつけで見た目、手触り等をリアルカーボンに近い仕上がりにしています。<br>カーボンアイテム中最薄商品となり厚さ0.2mm以下なので施工部分の段差が少なく、仕上がりの違和感もあまり感じません。<br><br>ドライヤー等で熱することによりかなりの伸縮性を発揮します。<br>内装、外装どちらでも使用可能です。<br><br><br>■適合車種 ： アルファード GGH/ANH20系(2008.5～)<br>■商品内容 ： ピラーセット スタンダードタイプ<br>■カラー ： ブラック<br><br>■メーカー品番 ： MS-PT51<br>■メーカー ： HASEPRO/ハセプロ<br><br><br>※商品画像はイメージとなり他のカラーが使用されている場合がございますが、販売カラーはブラックとなります。<br>※車種専用のカーボン柄シートのみの販売となります。<style type="text/css">
